import React from "react";
import ReactDom from 'react-dom';
import logo from './logo.svg'
import './style.css';


const Element = <>
  <nav class = "Navbar">
    <img src = {logo} class = "logo"/>
    <h1>React Facts</h1>
    <h2>React Course-Project 1</h2>
  </nav>
</>




const root = ReactDom.createRoot(document.getElementById('root'));
root.render(Element);
